import React from 'react';

export default function Contact() {
  return (
    <div className='form'>
      <h1>Contact Us</h1>
      <form>
        <label>Name:</label>
        <input type='text' name='name' required />
    
        <label>Email:</label>
        <input type='email' name='email' required />
        
        <label>Message:</label>
        <textarea name='message' required></textarea>

        <input type='submit' value='Submit' />
      </form>
    </div>
  );
}
